import React from "react";
import { Button, TitleButton } from "./styles";

interface ILoadButtonProps {
  offset:number;
}
export default function LoadHeroButton({offset, ...props}:ILoadButtonProps){
  return (
    <Button>
      <TitleButton>Adicionar Heroes Selecionados e Selecionar Mais Heroes</TitleButton>
    </Button>
  );
}
